$(function () {
  $(document).on("click", "a[data-open-url],button[data-open-url]", function (event) {
    event.preventDefault();
    var $link = $(event.currentTarget);
    var $modal = $("#" + $link.data("open"));
    $modal.html("<div class='loading-spinner'></div>");
    $.ajax({
      type: "get",
      url: $link.data("open-url"),
      success: function success(html) {
        var $html = $(html);
        $modal.html($html);
        $html.foundation();
      },
      error: function error(request, status, _error) {
        $modal.html("<h3>" + status + "</h3><p>" + _error + "</p>");
      }
    });
  });
});
"use strict";

$(function () {
  var $modal = $("#show-email-modal");

  if ($modal.length === 0) {
    return;
  }

  var $button = $("[data-open=user_email]", $modal);
  var $email = $("#user_email", $modal);
  var $fullName = $("#user_full_name", $modal);

  $("[data-toggle=show-email-modal]").on("click", function (event) {
    event.preventDefault();

    $button.show();
    $button.attr("data-open-url", event.currentTarget.href);
    $fullName.text($(event.currentTarget).data("full-name"));
    $email.html("");
  });
});
